import React from 'react';
import ProfileImage from '../component/ProfileImage';
import HomeDetails from '../component/HomeDetails';
import CurrentCompany from '../component/CurrentCompany';
import Buttons from '../component/Buttons';
import ContactOptions from '../component/ContactOptions';
import Languages from '../data/languages'; // or wherever this is coming from

function Home() {
  return (
    <div className="overflow-y-auto min-h-screen bg-whitewash text-[#2f2f2f] dark:bg-gray-900 dark:text-white transition-colors duration-300">
      {/* Top Section */}
      <div className="top-home-cont px-4 md:px-16 pt-12">
        <div className="mob-profile mb-6 flex justify-center">
          <ProfileImage />
        </div>

        <div className="bg-sand dark:bg-gray-800 p-6 rounded-2xl shadow-md transition-colors duration-300">
          <HomeDetails />
        </div>
      </div>

      {/* Middle Section - Job & Skills */}
      <div className="py-10 flex flex-col items-center gap-6 px-4 md:px-16">
        <div className="w-full bg-sand dark:bg-gray-800 p-6 rounded-2xl shadow-md transition-colors duration-300">
          <CurrentCompany />
        </div>

        <div className="w-full bg-sand dark:bg-gray-800 p-6 rounded-2xl shadow-md transition-colors duration-300">
          <Buttons Languages={Languages} />
        </div>
      </div>

      {/* Bottom Section */}
      <div className="bottom-home-cont bg-azuresea text-white dark:bg-sea p-6 rounded-t-2xl shadow-inner transition-colors duration-300">
        <ContactOptions />
      </div>
    </div>
  );
}

export default Home;
